import React, { Component } from 'react';
import PropTypes from 'prop-types';

const Card = (props) => {
	return <a
		target="_blank"
		href={props.url}
		style={{left: props.positions.left, top: props.positions.top}}
		onMouseDown={props.move}
		className={"display-card " + props.class}></a>
}

class Projects extends Component {
	constructor() {
		super()
		this.state = {
			cards: [
				{top: 100, left: 300},
				{top: 200, left: 100},
				{top: 600, left: 100}
			],
			urls: [
				'https://www.toolboxproject.io',
				'https://amaclean2.github.io',
				'https://devfestsf.com'
			]
		}
	}

	moveCards = (e) => {
		let positions = this.state.positions;
		console.log(e.target.left);
	}

	render() {
	    return (<div className="Projects">
	    	<Card
	    		positions={this.state.cards[0]}
	    		move={this.moveCards}
	    		url={this.state.urls[0]}
	    		class={'toolbox'} />
	    	<Card
	    		positions={this.state.cards[1]}
	    		move={this.moveCards}
	    		url={this.state.urls[1]}
	    		class={'lessonbox'} />
	    	<Card
	    		positions={this.state.cards[2]}
	    		move={this.moveCards}
	    		url={this.state.urls[2]}
	    		class={'devfest'} />
	    </div>);
	}
}

Projects.propTypes = {
}

export default Projects;
